import React from "react";
import { Link } from "react-router-dom";
import style from "./styles.module.scss";
import Moment from "react-moment";

const ContactRead = (contact) => {
  return (
    <div className={style["blog"]}>
      <div className={style["blog__body"]}>
        <Link
          className={style["blog__body__title"]}
          to={`/blogs/${contact.id}`}
        >
          {contact.name}
          <div className={style['contact__body__email']}>
          {contact.email}
          </div>
        </Link>
        <div className={style["blog__body__info"]}>
          <Moment date={contact.sentAt} format="DD MMM, YYYY" />
        </div>
        <span>
          {contact.messenger}
          <br />
          <Link
            className={style["blog__body__info"]}
            to={`/contacts/${contact.id}`}
          >
            Read...
          </Link>
        </span>
      </div>
    </div>
  );
};

export default ContactRead;
